const Card = (props) => {
  const {name, continent, image} = props
  const flags = JSON.parse(image)
  const flagURLs = flags.split(',')

  return (
    <div>
      <h1>{name}</h1>
      <h2>{continent}</h2>
      <img src={flags} alt={name} />
    </div>
  )
}

export default Card
